/* Login 라우트*/

import React from "react";
import Login from "../components/login/Login";
import Header from "../components/header/Header";

const LoginPage = ({ location }) => {
  return (
    <>
      <Header />
      <Login />
    </>
  );
};

export default LoginPage;
